import React from "react";
import { NavLink } from "react-router-dom";
import webb from '../src/image/img2.svg'
const Common = (props) => {
  return (
    <>
      <section id="header" className="d-flex align-content-center">
        <div className="container-fluid Nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
            <div className="row">
               <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                <h1>{props.name} <strong className="brand-name"> JENA Tech</strong></h1>
                <h2 className="my-3">We are Team of talent developers</h2>
                <div className="mt-3">
                    <NavLink to={props.visit} className="btn-get-started">Get Started</NavLink>
                </div>
               </div>    
               <div className="col-md-6 order-1 order-lg-2 header-img">
                 <img src={props.webb} className="img-fluid animated" alt="webing"/>
               </div>
            </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Common;
